import React from "react";

const Footer = () => {

    return (
        <div className={"footer"}>
            <div className={"copyright"}>Copyright 2020</div>
            <div className={"social-icons"}>
                <a href="https://facebook.com"><div className="facebook-icon"></div></a>
                <a href="https://instagram.com"><div className="instagram-icon"></div></a>
            </div>
        </div>
    )
};

export default Footer;
